CREATE TABLE agreements_with_details (
    id UUID PRIMARY KEY,
    agreement_number VARCHAR(50),
    status VARCHAR(50),
    start_date TIMESTAMP,
    end_date TIMESTAMP,
    rent_amount DECIMAL(10,2),
    created_at TIMESTAMP,
    updated_at TIMESTAMP,
    license_plate VARCHAR(20),
    make VARCHAR(50),
    model VARCHAR(50),
    year INT,
    vehicle_status VARCHAR(50),
    customer_name VARCHAR(100),
    customer_email VARCHAR(100),
    customer_phone VARCHAR(30),
    customer_driver_license VARCHAR(50),
    payment_count INT,
    total_paid_amount DECIMAL(10,2),
    first_payment_date TIMESTAMP,
    last_payment_date TIMESTAMP,
    total_late_fees_paid DECIMAL(10,2),
    payment_summary TEXT,
    total_fines INT,
    total_fines_amount DECIMAL(10,2),
    paid_fines_amount DECIMAL(10,2),
    pending_fines_amount DECIMAL(10,2),
    fines_summary TEXT,
    total_amount DECIMAL(10,2)
);

